import React from 'react';

function DefineAxes() {
    return (
        <div className="define-axes">
            <h2>Define Axes</h2>
            <label>x-axis</label>
            <input type="txt"></input>
            <label>y-axis</label>
            <input type="txt"></input>
        </div>
    )
}

export default DefineAxes
